import React from "react";

export default class SearchGit extends React.Component {
    constructor(props){
        super(props)
        this.state = {value: ''};

        this.searchValue = this.searchValue.bind(this)
    }

    searchValue(event){
        console.warn(event)
    }


    render(){
        return (
            <div>
           <div>Git Searcher</div> 
           <form >     
           <input type="text" value={this.state.value} onChange={this.searchValue}></input>          
           </form>
           </div>
        );
    }
}
